import React, { useState } from 'react';
import './Settings.css';

const Settings = () => {
  const [language, setLanguage] = useState('zh');
  const [theme, setTheme] = useState('light');

  const languages = [
    { code: 'zh', name: '‰∏≠Êñá', flag: 'üá®üá≥' },
    { code: 'en', name: 'English', flag: 'üá∫üá∏' }
  ];

  const themes = [
    { id: 'light', name: 'ÊµÖËâ≤‰∏ªÈ¢ò', icon: '‚òÄÔ∏è', description: 'Êòé‰∫ÆÊ∏ÖÊô∞ÁöÑÁïåÈù¢' },
    { id: 'dark', name: 'Ê∑±Ëâ≤‰∏ªÈ¢ò', icon: 'üåô', description: 'Êä§ÁúºÁöÑÊ∑±Ëâ≤ÁïåÈù¢' },
    { id: 'auto', name: 'Ë∑üÈöèÁ≥ªÁªü', icon: 'üîÑ', description: 'Ëá™Âä®Ë∑üÈöèÁ≥ªÁªüËÆæÁΩÆ' }
  ];

  const handleLanguageChange = (langCode) => {
    setLanguage(langCode);
    // TODO: ÂÆûÁé∞ËØ≠Ë®ÄÂàáÊç¢ÈÄªËæë
    console.log('Language changed to:', langCode);
  };

  const handleThemeChange = (themeId) => {
    setTheme(themeId);
    // TODO: ÂÆûÁé∞‰∏ªÈ¢òÂàáÊç¢ÈÄªËæë
    console.log('Theme changed to:', themeId);
  };

  return (
    <div className="settings-page">
      <div className="settings-header">
        <h2>ËÆæÁΩÆ</h2>
        <p>Ëá™ÂÆö‰πâ‰Ω†ÁöÑAPIÊµãËØïÂπ≥Âè∞‰ΩìÈ™å</p>
      </div>

      <div className="settings-content">
        {/* ËØ≠Ë®ÄËÆæÁΩÆ */}
        <div className="settings-section">
          <div className="section-header">
            <h3>ËØ≠Ë®ÄËÆæÁΩÆ</h3>
            <p>ÈÄâÊã©‰Ω†ÂÅèÂ•ΩÁöÑÁïåÈù¢ËØ≠Ë®Ä</p>
          </div>

          <div className="language-options">
            {languages.map((lang) => (
              <div
                key={lang.code}
                className={`language-option ${language === lang.code ? 'active' : ''}`}
                onClick={() => handleLanguageChange(lang.code)}
              >
                <div className="language-flag">{lang.flag}</div>
                <div className="language-info">
                  <div className="language-name">{lang.name}</div>
                  <div className="language-code">{lang.code.toUpperCase()}</div>
                </div>
                {language === lang.code && (
                  <div className="language-check">‚úì</div>
                )}
              </div>
            ))}
          </div>
        </div>

        {/* ‰∏ªÈ¢òËÆæÁΩÆ */}
        <div className="settings-section">
          <div className="section-header">
            <h3>‰∏ªÈ¢òËÆæÁΩÆ</h3>
            <p>ÈÄâÊã©‰Ω†ÂñúÊ¨¢ÁöÑÁïåÈù¢‰∏ªÈ¢ò</p>
          </div>

          <div className="theme-options">
            {themes.map((themeOption) => (
              <div
                key={themeOption.id}
                className={`theme-option ${theme === themeOption.id ? 'active' : ''}`}
                onClick={() => handleThemeChange(themeOption.id)}
              >
                <div className="theme-icon">{themeOption.icon}</div>
                <div className="theme-info">
                  <div className="theme-name">{themeOption.name}</div>
                  <div className="theme-description">{themeOption.description}</div>
                </div>
                {theme === themeOption.id && (
                  <div className="theme-check">‚úì</div>
                )}
              </div>
            ))}
          </div>
        </div>

        {/* ÂÖ∂‰ªñËÆæÁΩÆ */}
        <div className="settings-section">
          <div className="section-header">
            <h3>ÂÖ∂‰ªñËÆæÁΩÆ</h3>
            <p>Êõ¥Â§ö‰∏™ÊÄßÂåñÈÄâÈ°π</p>
          </div>

          <div className="other-settings">
            <div className="setting-item">
              <div className="setting-info">
                <div className="setting-name">Ëá™Âä®‰øùÂ≠ò</div>
                <div className="setting-description">Ëá™Âä®‰øùÂ≠òËØ∑Ê±ÇÂéÜÂè≤</div>
              </div>
              <label className="switch">
                <input type="checkbox" defaultChecked />
                <span className="slider"></span>
              </label>
            </div>

            <div className="setting-item">
              <div className="setting-info">
                <div className="setting-name">ËØ∑Ê±ÇË∂ÖÊó∂</div>
                <div className="setting-description">ËÆæÁΩÆËØ∑Ê±ÇË∂ÖÊó∂Êó∂Èó¥ÔºàÁßíÔºâ</div>
              </div>
              <input
                type="number"
                className="timeout-input"
                defaultValue="30"
                min="1"
                max="300"
              />
            </div>

            <div className="setting-item">
              <div className="setting-info">
                <div className="setting-name">ÂìçÂ∫îÊ†ºÂºèÂåñ</div>
                <div className="setting-description">Ëá™Âä®Ê†ºÂºèÂåñJSONÂìçÂ∫î</div>
              </div>
              <label className="switch">
                <input type="checkbox" defaultChecked />
                <span className="slider"></span>
              </label>
            </div>
          </div>
        </div>

        {/* Êìç‰ΩúÊåâÈíÆ */}
        <div className="settings-actions">
          <button className="btn btn-secondary">ÈáçÁΩÆËÆæÁΩÆ</button>
          <button className="btn btn-primary">‰øùÂ≠òËÆæÁΩÆ</button>
        </div>
      </div>
    </div>
  );
};

export default Settings;
